import React, { Component } from 'react'
import { NavBar,  Carousel , SearchBar, Button, WhiteSpace, WingBlank} from 'antd-mobile';

export default class Shop extends Component {
    render() {
        return (
            <div>
                {/* <NavBar style={{backgroundColor:'#3fcccb',color:'white'}}>商城</NavBar> */}
                <NavBar style={{backgroundColor:'#3fcccb',color:'white'}}
                rightContent={[
                    <Icon key='0' type='search' style={{marginRight:'16px'}} />
                ]}
                >商城</NavBar>
                <WingBlank><div className="sub-title"></div></WingBlank>
                <SearchBar placeholder="Search" maxLength={8} />
                <WhiteSpace />
            </div>
        )
    }
}
